/**
 * success.js
 * Created by zyc on 17/7/3.
 */
import Vue from 'vue';
import success from './success.vue';

Vue.config.productionTip = false;

/* eslint-disable no-new */
/* eslint-disable no-unused-vars */
const vm = new Vue({
  el: '#page',
  template: '<success />',
  components: { success }
});
window.rns = {};
